    "source": "pragma solidity ^0.4.23;\n\ncontract SaffronLog {\n    \n    event LogRecord(string project_Title, string project_Stage, uint ownerId, string ownerName, uint status, string registration_type, string package);\n    uint length = 0;\n    \n    mapping (uint => ProjectRgistrationDetails) Creators;\n  \n    struct ProjectRgistrationDetails {\n        uint projectId;\n        string project_Title;\n        string project_Stage;\n\t\tuint ownerId; \n\t\tstring ownerName; \n\t\tuint status; \n\t\tstring registration_type; \n\t\tstring package;\n    }\n   \n    mapping (bytes32 => ProjectRgistrationDetails) bbjects;\n    \n    function addProjectRgistrationDetails(uint _projectId, string _project_Title, string _project_Stage, uint _ownerId, string _ownerName, uint _status, string _registration_type, string _package) public returns (bool) {\n        ProjectRgistrationDetails memory ProjectRgistrationDetailsObject = ProjectRgistrationDetails(_projectId, _project_Title, _project_Stage, _ownerId, _ownerName, _status, _registration_type, _package);\n        bytes32 id = keccak256(ProjectRgistrationDetailsObject.project_Title, ProjectRgistrationDetailsObject.project_Stage, now, length);\n        bbjects[id] = ProjectRgistrationDetailsObject;\n\t\t\n        emit LogRecord(_project_Title, _project_Stage, _ownerId, _ownerName, _status, _registration_type, _package);\n        \n        var ProjectRgistrationList = Creators[_projectId];\n        ProjectRgistrationList.project_Title = _project_Title;\n        ProjectRgistrationList.project_Stage = _project_Stage;\t\t\n\t\tProjectRgistrationList.ownerId = _ownerId;\n        ProjectRgistrationList.ownerName = _ownerName;\n\t\tProjectRgistrationList.status = _status;\n        ProjectRgistrationList.registration_type = _registration_type;\n\t\tProjectRgistrationList.package = _package;\n    }\n    \n    function getProjectDetailsById(uint _projectId) view public returns (string, string, uint, string, uint, string, string) {\n        return (Creators[_projectId].project_Title, Creators[_projectId].project_Stage, \n\t\t\t\tCreators[_projectId].ownerId, Creators[_projectId].ownerName, Creators[_projectId].status, \n\t\t\t\tCreators[_projectId].registration_type, Creators[_projectId].package);\n    }\n}\n",
